import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

// This is the new component to display My Jobs
function MyJobsSection() {
  const [myJobs, setMyJobs] = useState([]);

  // Simulating fetching alumni's job posts
  useEffect(() => {
    // Example job data (this would be fetched from an API)
    const fetchedMyJobs = [
      {
        id: 1,
        title: 'PHP Developer',
        company: 'Company 1',
        location: 'Location 1',
        area: 'IT/ Management',
        appliedDate: 'Applied 2 months ago',
      },
      {
        id: 2,
        title: 'Java Developer',
        company: 'Company 1',
        location: 'Location 1',
        area: 'IT/ Management',
        appliedDate: 'Applied 8 months ago',
      },
      // Add more jobs as needed
    ];

    // Update state with fetched jobs
    setMyJobs(fetchedMyJobs);
  }, []);

  return (
    <div className="container mt-4">
      <h2>My Jobs ({myJobs.length})</h2>
      
      {/* Rendering job cards dynamically */}
      {myJobs.map((job) => (
        <div className="card mb-3" key={job.id}>
          <div className="card-body">
            <h5 className="card-title">{job.title}</h5>
            <p className="card-text">
              <strong>Company :</strong> {job.company}<br/>
              <strong>Job Location :</strong> {job.location}<br/>
              <strong>Job Area :</strong> {job.area}
            </p>
            <p className="text-muted text-right">
              {job.appliedDate}
            </p>
          </div>
        </div>
      ))}
    </div>
  );
}

function JobSection() {
  const [jobs, setJobs] = useState([]);
  const [showMyJobs, setShowMyJobs] = useState(false);

  useEffect(() => {
    // Example job data
    const fetchedJobs = [
      {
        id: 1,
        title: 'PHP Developer',
        company: 'Company 1',
        location: 'Location 1',
        area: 'IT/ Management',
        skills: 'PHP, HTML, CSS, Bootstrap',
      },
      {
        id: 2,
        title: 'PHP Developer',
        company: 'Company 1',
        location: 'Location 1',
        area: 'IT/ Management/Digital Marketing',
        skills: 'PHP, HTML, CSS, Bootstrap',
      },
      // Add more jobs as needed
    ];

    setJobs(fetchedJobs);
  }, []);

  if (showMyJobs) {
    return <MyJobsSection />;
  }

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h2>Job Section</h2>
        <button className="btn btn-warning">Post a New Job</button>
      </div>
      
      <div className="mb-3">
        <input 
          type="text" 
          className="form-control" 
          placeholder="Type a Job Role, Location, Domain" 
        />
        <button className="btn btn-primary mt-2">Search</button>
      </div>

      <div className="mb-3">
        <button 
          className="btn btn-light"
          onClick={() => setShowMyJobs(true)}
        >
          My Jobs
        </button>
      </div>

      {/* Rendering job cards dynamically */}
      {jobs.map((job) => (
        <div className="card mb-3" key={job.id}>
          <div className="card-body">
            <h5 className="card-title">{job.title}</h5>
            <p className="card-text">
              <strong>Company :</strong> {job.company}<br/>
              <strong>Job Location :</strong> {job.location}<br/>
              <strong>Job Area :</strong> {job.area}<br/>
              <strong>Skills :</strong> {job.skills}
            </p>
          </div>
        </div>
      ))}
    </div>
  );
}

export default JobSection;
